Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 5\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"46\"\r\n   Name=\"List Table 1 Light Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"51\"\r\n   Name=\"List Table 6 Colorful Accent 6\"/>\r\n  <w:LsdException Locked=\"false\" Priority=\"52\"\r\n   Name=\"List Table 7 Colorful Accent 6\"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!--[if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:\"Normální tabulka\";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:\"\";\r\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n	mso-para-margin-top:0cm;\r\n	mso-para-margin-right:0cm;\r\n	mso-para-margin-bottom:8.0pt;\r\n	mso-para-margin-left:0cm;\r\n	line-height:107%;\r\n	mso-pagination:widow-orphan;\r\n	font-size:11.0pt;\r\n	font-family:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]-->\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Sezóna 2025 je pro\r\nsilniční cyklistiku opravdu velmi významnou. Právě s koncem letošního roku\r\nkončí tříleté období, v němž můžou týmy získávat body do UCI žebříčku. Ten následně\r\nurčí 18 týmů, jež si pro nadcházející tříletý cyklus zajistí World Tour\r\nlicenci. My se v tomto článku zaměříme na aktuální stav žebříčku a zjistíme,\r\njaké týmy budou mít největší problémy s udržením licence.</b></p>\r\n\r\n<p class=\"MsoNormal\">Na začátek si ale musím říct, co vlastně WorldTour licence\r\nznamená. Jedná se o <b style=\"mso-bidi-font-weight:normal\">jakési povolení,\r\nkteré týmům umožňuje účastnit se závodů nejvyšší kategorie</b>. Každý tým může\r\nběhem roku odmítnout pouze dvě pozvánky. Všech zbylých závodů World Tour se tým\r\nmusí účastnit.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Privilegované je 19.\r\na 20. místo žebříčku</b>, které zaručuje pozvánky na všechny World Tour závody,\r\nale týmy na těchto pozicích je nemusí přijímat. Ostatní Pro Tour týmy se musí\r\nspoléhat na <b style=\"mso-bidi-font-weight:normal\">organizátory, kteří často\r\nudělují divoké karty</b>. Díky nim se týmy kategorie Pro Tour mohou účastnit\r\ntěch největších závodu, ale nikdy nemají úplnou jistotu, že se postaví na\r\nstart.</p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Na Grand Tour rovněž\r\nfunguje systém divokých</b> karet. Automaticky dostávají pozvánku 19. a 20. tým\r\nnaposledy ukončeného žebříčku. Na celkový počet 22 týmů se peloton <b style=\"mso-bidi-font-weight:normal\">dostává po volbě divokých karet, které\r\nvybírá samotný organizátor závodu</b>. Často vídáme jev, kdy pořadatelé\r\nvybírají domácí týmy, které mají velkou motivaci se ukázat na domácí půdě.</p><p class=\"MsoNormal\"><img src=\"data:image/jpeg;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Aktuálně jednotlivé <b style=\"mso-bidi-font-weight:normal\">stáje\r\ndostávají pozvánky podle žebříčku z let 2020 - 2022</b>. Na 19. a 20. místě\r\ntehdy skončil tým Lotto a Israel - Premier Tech. Do elitní osmnáctky týmů se v\r\ntomto období nevešly týmy jako Uno X, Q36.5, Tudor nebo Total Energies. <b style=\"mso-bidi-font-weight:normal\">Naopak těsně se podařilo získat licenci týmu\r\nAstana XDS nebo Arke BaB Hotels</b>.</p>\r\n\r\n<p class=\"MsoNormal\">Od začátku roku 2023 ale začalo sbírání UCI bodů od nuly,\r\ntakže <b style=\"mso-bidi-font-weight:normal\">úplně všechny týmy měly z hlediska\r\nbodů stejnou startovací pozici. </b>Aktuálně nám zbývá jen několik málo měsíců\r\ndo konce tříletého období a už skoro s jistotou víme, že <b style=\"mso-bidi-font-weight:\r\nnormal\">na prvním místě skončí tým UAE Emirates XRG, který zatím nasbíral přes\r\n72 tisíc bodů.</b> Druhá Visma teprve nedávno překročila hranici 50 tisíc bodů.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\">Teď se ale podívejme na druhou stranu spektra. Už skoro\r\njistě víme, že<b style=\"mso-bidi-font-weight:normal\"> se</b> <b style=\"mso-bidi-font-weight:normal\">tým Lotto po letošku opět vrátí do World\r\nTour</b>. To samé můžeme říci i o týmu Israel Premier Tech. Naopak o své místo\r\nby se <b style=\"mso-bidi-font-weight:normal\">měly strachovat týmy Intermarché -\r\nWanty, Picnik PostNL a Cofidis.</b> Ty se totiž nacházejí na posledních třech\r\npostupových místech.</p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Těsně pod čarou se\r\nnachází trojice týmů Astana XDS, Uno X a Arkea BaB Hotels</b>. Tyto tři týmy\r\nmají na kontě přes 16 tisíc bodů a ztrácí na elitní osmnáctku okolo 3 tisíc\r\nbodů. Týmy Uno X a ani Arkea BaB Hotels v letošní sezóně <b style=\"mso-bidi-font-weight:\r\nnormal\">nezaznamenávají takové výsledky, aby bylo v jejich možnostech ztrátu\r\nstáhnout</b>, takže se musí spokojit se svou aktuální pozicí.</p><p class=\"MsoNormal\"><img src=\"data:image/png;base64,\" alt=\"\"></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Nejvyšší ambice ze\r\nzmiňované trojice má Astana XDS, která před letošním rokem mohutně posílila </b>a\r\nchce v posledním roce licenci vybojovat. Zatím se jim daří ztrátu mazat. Často\r\nse jezdci Astany <b style=\"mso-bidi-font-weight:normal\">zapojují do sprintů ve\r\nvětším počtu, aby získali co možná nejvíce bodů</b>. A to se zatím daří,\r\njelikož letos získali už necelých 3 tisíce bodů. Stále ale tým z Kazachstánu\r\nzůstává na 21. místě.</p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\">Všechny uvedené informace jsou aktuální k datu 7. března 2025. Pořadí se může s následujícími závody měnit. Odkaz na žebříček najdete <a href=\"https://www.procyclingstats.com/rankings.php?date=2025-03-07&amp;filter=Filter&amp;p=me&amp;s=ranking-2023-2025\" target=\"_blank\">ZDE</a></b></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\"><br></p><p class=\"MsoNormal\">zdroj obrázků: procyclingstats.com</p><p class=\"MsoNormal\"><br></p>\r\n\r\n', 6, 'ktere-tymy-prijdou-v-roce-2025-o-world-tour-licenci-');
INSERT INTO `clanky` (`id`, `nazev`, `datum`, `viditelnost`, `nahled_foto`, `obsah`, `user_id`, `url`) VALUES
(787, 'TEST: Cannondale SuperX - Jednoduše skvělý! Ale pro koho vlastně?', '2025-03-12 18:00:00', 1, 'C25_SuperX_Lifestyle Photography (10).jpg', '\r\n        \r\n        \r\n        \r\n        Do rukou se nám dostala<b> jedna z nejžhavějších novinek</b> cyklistického světa. Konkrétně zbrusu nový<b> Cannondale SuperX!</b> Záměrně nepíšu, o jakou kategorii kola se jedná. Jednak by to každý fanoušek cyklistiky <b>měl vědět</b> už podle názvu a druhak to <b>není tak jednoduché určit</b>.<div><font face=\"Fira Sans Condensed, sans-serif\"><br></font></div><div><font face=\"Fira Sans Condensed, sans-serif\"><p></p><div class=\"iframe\"><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/aS7hzZc6tWo?si=BnrMgwAyXihADJKJ\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></div><br></font><div><font face=\"Fira Sans Condensed, sans-serif\"><br></font></div><div><h2><font face=\"Fira Sans Condensed, sans-serif\">Trocha historie&nbsp;</font></h2><div><br></div><div>Jak zmiňuji výše - <b>SuperX </b>není<b> žádné nové jméno</b>. Cannondale tímto modelem v historii již <b>disponoval</b>. Později se z něj staly<b> SuperSix EVO SE a EVO CX</b>. Jak název napovídá, tak CX byl<b> čistě cyklokrosový model</b> a SE zase <b>gravel</b>. Tak to dává perfektní smysl. Dva modely na<b> dvě rozdílné věci</b>. Cyklokroska nepotřebuje skrz UCI pravidla <b>nikterak velkou průchodnost</b>, navíc musí být obratná kvůli<b> charakteru tratí této disciplíny</b>. Gravel zase potřebuje prostor pro objemné pláště zajišťující<b> pohodlí pro jezdce</b> a geometrii vhodnou pro pohodlnou jízdu cestou necestou. Ale teď přijde ten <b>šok! </b>Cannondale tyto dva na první pohled rozdílné světy opět <b>spojil do jednoho kola</b>, které nese ono univerzální jméno <b>SuperX</b>. A jak se jim to povedlo?</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d248ecdc4-C25_LAB71_SuperX_BMB_Beauty (12).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Odpoveď na právě položenou otázku vám <b>nedám ihned</b>. Pro pochopení mé úvahy a soudu se musíme nejprve podívat na některé spojitosti a další věci, mezi které patří také <b>osazení a varianty</b>.&nbsp;</div><div><br></div><h2>Aktuální nabídka</h2><div><br></div><div>Já měl na test k dispozici model <b>SuperX 2</b> ve velikosti <b>54</b>. Ten je v aktuální nabídce značky <b>na prostřední pozici</b>. Nad ním je varianta <b>LAB71</b>, která u tohoto cyklistického giganta značí vždy to nejlepší napříč modely. Samozřejmě <b>nejlehčí a nejtužší rám</b> a spolu s ním pochopitelně nejlepší osazení. Zde konkrétně dali na americké kolo americkou bezdrátovou sadu - <b>Sram Red XPLR AXS</b>. Tedy nejlepší jednoplacka, kterou můžete od tohoto výrobce dostat. Karbonová kola, kombo. <b>Nekompromisní kolo</b> s nekompromisní cenovkou<b> 379 999 Kč</b>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d283a3b18-C25_LAB71_SuperX_BMB (1).jpg\" alt=\"\"><em></em><br><br><em></em></div><div><br></div><div>Na druhém konci nabídky - pod naší dvojkou - je pak <b>SuperX 3</b>. Zde je od výrobce nastavena cena <b>114 999 Kč</b>. V tomto případě dostaneme <b>\"základní\" rám</b>, dvouplacku <b>GRX 820</b> od japonského <b>Shimana </b>v mechanickém provedení a hliníková kola <b>DTSwiss 1800</b>. Podrobnější specifikace těchto modelů můžete omrknout <a href=\"https://www.cannondalebikes.cz/jizdni-kola/gravel-bike/gravel/superx\" target=\"_blank\">zde</a>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d26f30dbd-C25_SuperX_Crb_3_RAW (1).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Ve výčtu modelů jsem schválně zdůraznil tovární osazení jednoplackou u LAB71 a dvojpřevodníkem u SuperX 3. Z toho pochopitelně vyplývá, že tento rám <b>disponuje možností obou variant</b>. To je první z důležitých bodů ve snaze zkombinovat gravel a cyklokrosové kolo. Dalším z nich je<b> dostatečná propustnost rámu a vidlice</b>. Ta zde není hnána <b>do úplných extrémů</b>, což je za mě <b>v pořádku</b>. Pokud potřebuju na kole propustnost na 2,4 pláště, tak bych zvážil, jestli jsem zvolil <b>vhodný typ kola...</b> Možná to je ale jen můj chybný pohled vycházející z MTB historie. Každopádně zde je průchodnost nastavena na<b> 48 mm</b> u rámu a<b> 51 mm </b>ve vidlici. U obou se pak navíc počítá s tím, že v takovém případě zůstává<b> 4 mm rezerva</b>. Za mě naprosto <b>dostatečné</b>.&nbsp;</div><div><br></div><h2>SuperX 2</h2><div><br></div><div>Teď už pojďme na našeho <b>bílého fešáka</b>, který se nachází <b>přesně na pomezí </b>těchto dvou zmíněných. Ten taktéž disponuje dvěma převodníky a <b>sadou GRX</b>. Tentokrát ale ve variantě <b>GRX 825 Di2</b>. To s sebou nese hned několik specifik. Tato sada je relativně nová a má<b> přepracovaný design pák</b>, který je za mě neskutečně povedený. Neuvěřitelně <b>příjemně a přirozeně sednou </b>do ruky. Tedy alespoň mně. Dokonce se nebojím říct, že mi vyhovují víc, než aktuální silniční Di2 páky 105/Ultegra/Dura, na které <b>nedám dopustit! </b>Jsou ale malinko <b>delší</b>, čímž vám<b> prodlouží reach </b>a je potřeba s tím případně <b>počítat</b>. Tím pádem ale umožní o to<b> lepší opření předloktí </b>o řídítka a s tím spojený agresivní zalehnutý posed. Ostatně s tím se zde nejspíš počítá tak nějak přirozeně. Řazení je pak srovnatelné přibližně s Ultegrou.<b> Rychlé, přesné.</b> Jediné, co bych pákám vytkl je pozice třetího programovatelného tlačítka na vnitřní straně páky. Mně osobně se nemačká <b>úplně ideálně</b>. Kolo jsem testoval v únoru a počasí nebylo příznivé. Zimní rukavice a obecně dost ztuhlé ruce tomu asi nepomohly, ale na druhou stranu jejich <b>silniční protějšky se mačkají bez problému</b> i v těchto podmínkách. Věřím ale, že s trochou cviku bych tomu na chuť přišel.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d293e719d-C25_SuperX_Crb_2 (2).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Naopak extrémně povedené jsou <b>brzdy</b>. Třmeny <b>GRX 820</b>, nové páky a <b>160/160 kotouče CL800 </b>poskytují obrovský, agresivní brzdný výkon. <b>Velká pochvala! </b>Převodníky se <b>48 </b>a <b>31</b> zuby a<b> 11-34 </b>kazeta pokryjí naprosto dostatečně snad <b>veškeré představitelné sklony</b>. Ani silniční sjezdové rychlosti nad<b> 55 km/h </b>nejsou problém. Za zmínku stojí také středovka&nbsp;<b>BSA 68</b>.</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d2a113c1d-C25_SuperX_Crb_2 (1).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Kokpit u středního modelu SuperX 2 je složen z klasické hliníkové dvojice představce <b>Cannondale C1</b> a řídítek <b>Vision Trimax Aero</b>. Není to sice kombo, ale kokpit je velice <b>úhledný a uhlazený</b>. A co je za mě nejdůležitější - řídítka disponují <b>zploštěním</b> ve vrchní části. Široká jsou <b>38 cm</b>, což odpovídá závodnímu charakteru kola a počítá spíše s aerodynamickým <b>\"úzkým\"</b> posedem. Nenajdeme zde ani vyklonění oblouků, jako tomu bývá u pohodověji laděných gravelů.&nbsp;</div><div><br></div><div>Kola zde dodala značka <b>Reserve</b>. Konkrétně se jedná o jejich karbonové ráfky <b>40/44 mm</b> na <b>DTSwiss 370 CL</b> nábojích. Kola jsou spíše robustní. Ať už výškou ráfku, nebo jeho vnitřní šířkou, která činí<b> 25,5 mm</b> (25 mm vzadu). Vnější je pak <b>31 mm a 33 mm</b>. Jak jsem zmínil ve videu - ráfky se i přes svou výšku chovají na bočním větru velice dobře. Zajímavé je <b>šustění či syčení</b>, které je slyšet, když se do nich tento poryv opře. Na Reserve kolech jsou osazeny pláště<b> Vittoria Terreno T50</b>. Jak název <b>nenapovídá</b>, jedná se o <b>40 mm široké bezdušáky</b>. Vzorek je řekl bych středně terénní v rámci gravel kategorie. Ani do krutého bláta, ani čistě silniční. Prostě univerzál, který mě nezklamal ani na suché lesní cestě, ani na mírně změklém uježděném sněhu. Společně s koly toto kombo funguje nejlépe <b>ve vyšších rychlostech</b>. Vysoké ráfky hezky setrvačně <b>drží a derou se kupředu</b>. Pláště zároveň ani na silnici nemají zbytečný odpor.&nbsp;</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d2b72b9f8-C25_SuperX_Lifestyle Photography (2).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Tím se dostáváme k tomu, jaké tohle kolo je. V první řadě <b>hodně těžko popsatelné</b>. Mám cca<b> 178 cm</b> a velikost 54 mi <b>sedla bez problému</b>. Od začátku jsem ale měl z kola spíš <b>hravější pocit</b>. Jak kdybych seděl na něčem o číslo menším. Měl jsem pořád hroznou potřebu na něm <b>kličkovat po cestě</b>, dávat bunnyhopy přes každou prasklinu v asfaltu a podobně. <b>Otočit se na pětníku</b> kolem zábrany mu taky <b>nedělá problém</b>. Prostě cyklokroska jako vyšitá. No ale počkat... <b>Nemá to být i gravel?</b></div><div><b><br></b></div><div><b><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d2cd6a809-C25_SuperX_Lifestyle Photography (5).jpg\" alt=\"\"><em></em><br><br></b></div><div><br></div><div><b>První hodinová vyjížďka mi odpověď nedala.</b> Jel jsem v klidu, zvykal si na kolo. A pořád jsem měl pod sebou cyklokrosku a ne gravela, když tedy pominu průchodnost pro pláště. Ono se jim to spojení <b>asi nepovedlo!</b></div><div><br></div><div>Ale to jsem se mýlil. Klíč totiž leží ve slově závodní. Cannondale od začátku předkládá, že se jedná o <b>závodní stroj</b> určený na akce jako je <b>Unbound</b>. A to je přesně ono... dokud se pohybujete v nižších rychlostech, tak se kolo pořád<b> chová jako cyklokroska</b>. Je hravé, obratné. Ve vyšší rychlosti, když zalehnete a začnete jet full gas, tak se <b>uklidní</b> a začne se chovat <b>víc jako gravel</b>. Samozřejmě geometrie se mu nezmění, ale třeba právě ona setrvačnost kol atd. mu dodají jakousi<b> jistotu do začátek </b>a do dlouhých rovin. Nevím, jak to popsat, ale přál bych to každému <b>zažít a vyzkoušet</b>.&nbsp;</div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d2e44aa6f-C25_SuperX_Lifestyle Photography (9).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>Byť je rám pohledově subtilní, tak jeho zpracování ve mně <b>budí velkou důvěru</b>. Vypadá opravdu solidně. Je ale <b>tuhý</b>. A to v obou směrech. Pod zadkem vám sice pracuje materiál rámu, sedlovky a sedla, ale rozhodně je to pořád <b>jeden z těch tvrdších gravelů</b>. Samozřejmě i kvůli absenci pružícího prvku. Člověk tedy musí <b>dobře volit tlaky v pláštích</b>. Do záběru je kolo taky tuhé. Ale to je za mě možná slabé slovo. To kolo je jako <b>šutr! </b>Tužší než kdejaká silnička. Opět se potvrzuje jeho <b>závodní nátura</b>.</div><div><br></div><div>A právě slovem závodní by se dalo shrnout úplně vše. Samozřejmě, jak jsem i zmínil ve videu - pokud takové kolo chcete, tak vám určitě bránit nebudu. <b>Je to skvělé svezení. </b>V této kategorii ale už můžeme hledět i na drobné rozdíly mezi jednotlivými typy kol a tím pádem máme možnost si vybrat přesně to pravé pro naše potřeby. Chcete se kochat, vozit se cestou necestou se zahnutými řídítky? Pak je tu pro vás třeba Cannondale Topstone. Chcete<b> nekompromisně hltat kilometry</b>, drtit tréninky, závodit a nebo prostě jen <b>jezdit svižněji?</b> Tak je pro vás <b>SuperX přesně to pravé!&nbsp;</b></div><div><br></div><div><img src=\"https://www.magazin.cyklistickey.cz/assets/img/upload/clanek_obsah/67d1d2f8dd869-C25_SuperX_Lifestyle Photography (3).jpg\" alt=\"\"><em></em><br><br></div><div><br></div><div>A pokud si i tak nejste jistí, tak není nic jednoduššího, než si <b>vytipovat testovačku </b>nebo návštěvu obchodu, kde si kolo můžete osahat a udělat si svůj názor. To totiž podle mě <b>udělá vždy víc</b>, než nejlepší recenze na světě!</div><div><br></div><div>Pokud bys <b>sháněl SuperX</b> nebo jakékoliv<b> jiné kolo</b>, tak můžeš mrknout k nám na <a href=\"https://www.cycli.cz/\" target=\"_blank\"><b>Cycli.cz</b></a>&nbsp;a dát nám vědět, <b>rádi něco vymyslíme!</b></div></div>                </div>', 2, 'test-cannondale-superx---jednoduse-skvely-ale-pro-koho-vlastne'),
(788, 'Ze škarpy až na první místo! Tadej Pogačar ovládl Strade Bianche!', '2025-03-08 22:20:00', 1, 'Glh5KsKWsAAGvx1.jpg', '\r\n        \r\n        <b>Třetí vítězství na toskánské klasice je jeho!</b> Slovinský fenomén <b>Tadej Pogačar </b>ukázal, proč fenoménem je!&nbsp; Opět totiž zaútočil <b>80 km před cílem</b>. Na rozdíl od minulého roku se však dokázali udržet <b>Tom Pidcock s Bennem Swiftem</b> a tlak na rychlost ve sjezdech skončil pro Pogačara smeknutím zadního kola a<b> letem do příkopu</b>. Tom Pidcock na něj však sportovně počkal a <b>nechal závod rozhodnout výkonem</b>. Ten předvedl Tadej i po pádu a 19 km před cílem zaútočil znovu, tentokrát <b>už úspěšněji</b>. V cíli činil náskok na druhého Toma&nbsp;<b>1 minutu a 24 sekund</b>. Za ním na třetím místě dorazil<b> Tim Wellens</b>, díky čemuž vedle sebe na pódiu Strade Bianche stáli <b>týmoví kolegové po 9 letech</b>.<div><font face=\"Fira Sans Condensed, sans-serif\"><br></font></div><div><font face=\"Fira Sans Condensed, sans-serif\"><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/qno45DYZpgg?si=gMG9nm8QirWsaZUG\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></font></div><div><font face=\"Fira Sans Condensed, sans-serif\"><br></font><div>Trasa měřila<b> 213 km</b> a čítala <b>16 sektorů </b>s celkem<b> 82 km bílého štěrku</b>. Hned na prvním vjezdu do gravel úseků za to vzalo<b> 10 jezdců </b>a vytvořilo únik, který si po chvíli vydobyl náskok <b>až okolo 5 minut</b>, poněvadž v pelotonu<b> trochu zavládl chaos</b>, když přišly první pády.</div><div><br></div><div>Následně tempo začal udávat Pogačarův<b> UAE Team Emirates - XRG</b> a únik znejistěl. Rozjely se v něm četné útoky, které ho zredukovaly na<b> 6 lidí</b>. Mezitím se však blížil <b>81. kilometr </b>před cílem. Ten kilometr, kde minulý rok za sebou nechal Tadej všechny ostatní a dojel do cíle sám. Letka UAE v podobě<b>&nbsp;Floriana Vermeersche, Tima Wellense a Isaaca del Tora</b> se dala do ostrého pohybu, z čehož Tom Pidcock ucítil, že útok přijde opravdu brzy a<b> chytil se za Wellensovo zadní kolo</b>. Po chvíli se Tadej opravdu dal do pohybu a Pidcock se dokázal udržet. Ostatní<b> zůstali doslova v prachu</b>. Zanedlouho se k nim připojil <b>Connor Swift</b>, který odpadl z úniku a <b>odpočinul si při čekání na peloton</b>.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/xgGhv1bv_xo?si=Dk7kkULJjORnJKk9\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></div><div><br></div><div>Pak to ale přišlo,<b> středně ostrá levá zatáčka</b>&nbsp;z kopce a Tadejova příliš velká rychlost a náklon, které mu <b>způsobili podsmeknutí zadního kola</b> a tím nejprve ošklivé odření o silnici a následně i <b>kotrmelec do příkopu hlavou napřed</b>. Ošklivý pád mu způsobil <b>četné odřeniny</b> a samozřejmě i potrhání dresu. On se ale okamžitě zvedl a rozjel stíhací jízdu. Pidcock však <b>zpomalil své tempo a sportovně počkal</b>. Chvíli spolu jeli rychle ale v klidu, aby si <b>odpočali </b>a ve finále mohli opět pořádně závodit. Při nájezdu<b> do posledních 20 km</b> Pogačar opět zaútočil. Tentokrát to bylo na stoupání&nbsp;<b>Colle Pinzut </b>a Pidcock <b>nenašel dostatek sil na odpověď</b>.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/Bohb5vz0O8E?si=L7fNii-oCgt34BF8\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></div><div><br></div><div>V cíli činila ztráta <b>1 minutu a 24 vteřin</b>. Potrhaný ale usměvavý Slovinec si dojel po <b>3. titul na Strade</b>, čímž se stal nejen <b>prvním, komu se to povedlo</b>, ale rovněž <b>prvním mužským mistrem světa</b>, který na Sienské náměstí dorazil jako vítěz.</div><div><br></div><div>Pro Pidcocka to ale <b>rozhodně není prohra</b>. Jak je vidět, přestup do nového týmu mu opravdu svědčí a výkon, který dnes předvedl, je známkou toho, že <b>letos můžeme čekat velké věci</b>. Pro jeho tým <b>Q36.5</b> to navíc byl <b>nejlepší výsledek v jeho historii</b>. Tím se posouvá do úplně nového patra cyklistiky.</div><div><br></div><div>O <b>48 vteřin</b> později dorazil i <b>Tim Wellens</b>, který se zvedl ze stíhací skupinky a potvrdil, že <b>UAE</b> je opravdu právoplatně <b>nejlepším WorldTour týmem</b>.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/PDDRBnr14xA?si=BG4yU3vXi7_whSfX\" title=\"YouTube video player\" frameborder=\"0\" allow=\"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share\" referrerpolicy=\"strict-origin-when-cross-origin\" allowfullscreen=\"\"></iframe></div><br></div><div><br></div><div>Mistr světa se k závodu <b>viditelně v bolestech a skleslým hlasem </b>vyjádřil takto:&nbsp;„Užíval jsem si to <b>až do chvíle, než jsem projel cílovou páskou</b>. Teď ze mě adrenalin vyprchal a <b>začínám cítit hodně bolesti</b>. Není to nejlepší způsob, jak vyhrát závod, ale <b>výhra je výhra</b>. Doufejme, že to není nic horšího, než jak to vypadá. <b>Všechno by mělo být v pořádku.</b>“</div><div><br></div><div>„Myslím, že jsem <b>jel hodně rychle</b>. Tyhle silnice znám velmi dobře, jel jsem je už snad dvacetkrát v životě. <b>Někdy to ale člověk neodhadne</b>, nevím, uklouzl jsem. Takové věci se <b>stávají</b>. Nevěděl jsem, jestli jsem v pořádku. Kolo bylo rozbité a <b>musel jsem ho vyměnit</b>. Měl jsem strach, protože po pádu si tělo vezme hodně sil, ale pořád jich bylo <b>dost na to, abych závod dokončil</b>,\" popsal pád.</div><div><br></div><div>&nbsp;„Byl to skvělý závod, byl to <b>hodně vyrovnaný</b>. Na začátku se pár lidí utrhlo a naši kluci<b> odvedli skvělou práci vpředu</b>. Bylo to hodně těžké,“ uzavřel.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered\" id=\"instagram-embed-0\" src=\"https://www.instagram.com/p/DG8u-kLMEsv/embed/?cr=1&amp;v=14&amp;wp=675&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D788#%7B%22ci%22%3A0%2C%22os%22%3A634.7999999523163%2C%22ls%22%3A179.79999995231628%2C%22le%22%3A608%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"883\" data-instgrm-payload-id=\"instagram-media-payload-0\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div>Své pocity sdělil kamerám i Pidcock:&nbsp;„Abych byl upřímný, <b>jsem docela unavený</b>. Chtěl jsem vyhrát, ale buďme upřímní, <b>podal jsem dobrý výkon</b>,...byl jsem docela blízko.&nbsp;„Pokud se nepletu, <b>s Tadejem letos ještě nikdo nejel! </b>Dobře, má za sebou jen jeden závod, ale také loňskou Tour de France. Takže jo, mám radost. <b>Je to dobrýá jízda. </b>Ale samozřejmě v závěru ještě zaútočil a odjel. Takže je to takové <b>hořkosladké</b>.“</div><div><br></div><div>O pádu rivala následně řekl toto: „Co si budeme, <b>dalo mi to trochu větší příležitost</b>. Když spadl, pokračoval jsem dál, nevěděl jsem, co se děje. Ale pak se vrátil na kolo, vypadalo to, že se vrací, a tak jsem <b>samozřejmě počkal</b>. Je to skvělý závodník a mistr světa, takže to samozřejmě <b>respektujete a čekáte</b>. Udělal chybu a <b>takhle se výhoda v závodě nevyužívá</b>. A taky jsem nechtěl jet takovou dálku sám. <b>Byla to ještě dlouhá cesta</b>,\" dokončuje s úsměvem.</div><div><br></div><div><p></p><div class=\"iframe\"><iframe class=\"instagram-media instagram-media-rendered\" id=\"instagram-embed-1\" src=\"https://www.instagram.com/p/DG88X0HAgtv/embed/?cr=1&amp;v=14&amp;wp=675&amp;rd=https%3A%2F%2Fwww.admin.cyklistickey.cz&amp;rp=%2Fedit%2Fupravit.php%3Fid%3D788#%7B%22ci%22%3A1%2C%22os%22%3A639.5%2C%22ls%22%3A179.79999995231628%2C%22le%22%3A608%7D\" allowtransparency=\"true\" allowfullscreen=\"true\" frameborder=\"0\" height=\"567\" data-instgrm-payload-id=\"instagram-media-payload-1\" scrolling=\"no\" style=\"background: white; max-width: 540px; width: calc(100% - 2px); border-radius: 3px; border: 1px solid rgb(219, 219, 219); box-shadow: none; display: block; margin: 0px 0px 12px; min-width: 326px; padding: 0px;\"></iframe> <script async=\"\" src=\"//www.instagram.com/embed.js\"></script></div><br></div><div><br></div><div><b>Jak jste si závod užili u obrazovek?</b></div></div>        ', 4, 'ze-skarpy-az-na-prvni-misto-tadej-pogacar-ovladl-strade-bianche');
